import DoCell from "../components/doc-cell.vue";
export default {
  name: 'doc-list',
  data: function data() {
    return {
      list: []
    };
  },
  components: {
    DoCell: DoCell
  },
  mounted: function mounted() {
    var _this = this;

    this.$axios({
      url: '/api/home',
      params: {
        _page: 1,
        _limit: 2
      }
    }).then(function (res) {
      return _this.list = res.data.data;
    } // res=>console.log(res)
    );
  },
  updated: function updated() {},
  methods: {}
};
